    const {name,email,id} = props;
      <img src={`https://robohash.org/${id}?100x100`} alt='robot' />
      <div>
        <h2>{name }</h2>
        <p> {email} </p>
        </div>
    </div>
    // </div>
  );
}

export default Cards;
